import React from "react";
import "../style.css";

function Countdown() {
   return (<div className="homeDiv">
        <h1 className="heading">Nail time in:</h1>
        <div>
            Countdown goes in here.
        </div>
        <h3 className="headingTwo">Rock Up when the Clock Up</h3>
    </div>)
};

export default Countdown;
